import React from 'react';
import Header from './Header';
import Hero from './Hero';
import HighlightsSection from './HighlightsSection';
import HowItWorks from './HowItWorks';
import Footer from './Footer';

function HomePage() {
  return (
    <>
      <Header />
      <Hero />
      <HighlightsSection />
      <HowItWorks />
      <Footer />
    </>
  );
}

export default HomePage;
